    return (
            <View style={estilos.tela}>
                <View style={estilos.cabecalho}>
                    <View >
                        <Text>Bem-Vindo,    </Text>
                        <Text style={estilos.titulo}>Usu√°rio</Text>
                    </View>
                    <View>
                        <Image source={usuarioIcne}/>
                    </View>
                </View>
            </View>
    )
}

const estilos = StyleSheet.create({
    tela: {
        margin: 25
